import React from "react";

function Bule() {
  return (
    <>
      {window.sessionStorage.getItem("Dif") && (
        <>
          <div
            className="fullPage"
            style={{
              display: "flex",
              justifyContent: "flex-start",
              flexDirection: "column",
              padding: "0 100px",
            }}
                  >
                      
          </div>
        </>
      )}
    </>
  );
}

export default Bule;
